    _applyForAndReturnChanged(opt_idsArray, func, param) {
        const changed = [];
        if (opt_idsArray) {
            for (const id of opt_idsArray) {
                const b = this.bimElementsById[id];
                if (b && func(b, param)) {
                    changed.push(b.bimId);
                }
            }
        }
        else {
            for (const b of this.bimElementsArray) {
                if (func(b, param)) {
                    changed.push(b.bimId);
                }
            }
        }
        if (changed.length > 0) {
            this.bimsNeedUpdate = true;
        }
        return changed;
    }
